import React from 'react';
import { Container, Typography, Grid, Paper, Button, Box, AppBar, Toolbar, IconButton, Menu, MenuItem, CssBaseline } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Menu as MenuIcon } from '@mui/icons-material';
import { Link} from 'react-router-dom';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function Pricing() {
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleCheckout = async (plan) => {
    // Initialize Stripe with your public key
    const stripe = window.Stripe('YOUR_STRIPE_PUBLIC_KEY');

    // Map your plans to their respective Stripe Price IDs
    const priceIds = {
      'pro-lite': 'price_1RHh9iHB4FuKHL1pxkTQOfPd', // Replace with your actual Price ID for Pro Lite
      'pro': 'price_1RHhARHB4FuKHL1pUiWHACvC',      // Replace with your actual Price ID for Pro
      'exclusive': 'price_1RHhARHB4FuKHL1pJLJh1N1d'   // Replace with your actual Price ID for Exclusive
    };

    if (!priceIds[plan]) {
      console.error('Invalid plan selected');
      return;
    }

    try {
      // Redirect to Stripe Checkout
      const { error } = await stripe.redirectToCheckout({
        lineItems: [{ price: priceIds[plan], quantity: 1 }],
        mode: 'payment',
        successUrl: window.location.origin + '/success',
        cancelUrl: window.location.origin + '/cancel',
      });
      if (error) {
        console.error('Stripe checkout error:', error.message);
      }
    } catch (err) {
      console.error('Checkout error:', err);
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={handleMenuOpen}>
            <MenuIcon />
          </IconButton>
          <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleMenuClose}>
            <MenuItem component={Link} to="/" onClick={handleMenuClose}>Home</MenuItem>
            <MenuItem component={Link} to="/showcase" onClick={handleMenuClose}>Showcase</MenuItem>
            <MenuItem component={Link} to="/pricing" onClick={handleMenuClose}>Pricing</MenuItem>
          </Menu>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            FlipVault
          </Typography>
          <Button color="inherit" component={Link} to="/login">Log in</Button>
        </Toolbar>
      </AppBar>
      <Container maxWidth="lg" style={{ marginTop: '20px', textAlign: 'center' }}>
        <Typography variant="h3" gutterBottom>
          Plans and Pricing
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={12} md={4}>
            <Paper style={{ padding: '20px', backgroundColor: '#2c2c2c' }}>
              <Typography variant="h5" gutterBottom>
                Pro Lite
              </Typography>
              <Typography variant="h4" gutterBottom>
                $10USD
              </Typography>
              <Typography variant="subtitle1" gutterBottom>
                Per 30 days
              </Typography>
              <ul style={{ textAlign: 'left' }}>
                <li>200 product checks monthly</li>
                <li>Free vendors with every product check</li>
                <li>3 Discord product alerts a week</li>
              </ul>
              <Button
                variant="contained"
                color="primary"
                onClick={() => handleCheckout('pro-lite')}
              >
                Get started with Pro Lite
              </Button>
            </Paper>
          </Grid>
          <Grid item xs={12} md={4}>
            <Paper style={{ padding: '20px', backgroundColor: '#2c2c2c' }}>
              <Typography variant="h5" gutterBottom>
                Pro
              </Typography>
              <Typography variant="h4" gutterBottom>
                $17USD
              </Typography>
              <Typography variant="subtitle1" gutterBottom>
                Per 30 days
              </Typography>
              <ul style={{ textAlign: 'left' }}>
                <li>500 product checks</li>
                <li>Free vendors with every product</li>
                <li>10 Discord alerts weekly</li>
              </ul>
              <Button
                variant="contained"
                color="primary"
                onClick={() => handleCheckout('pro')}
              >
                Get started with Pro
              </Button>
            </Paper>
          </Grid>
          <Grid item xs={12} md={4}>
            <Paper style={{ padding: '20px', backgroundColor: '#2c2c2c' }}>
              <Typography variant="h5" gutterBottom>
                Exclusive
              </Typography>
              <Typography variant="h4" gutterBottom>
                $34USD
              </Typography>
              <Typography variant="subtitle1" gutterBottom>
                Lifetime
              </Typography>
              <ul style={{ textAlign: 'left' }}>
                <li>Unlimited product checks</li>
                <li>Free vendors with every product</li>
                <li>Unlimited Discord alerts</li>
              </ul>
              <Button
                variant="contained"
                color="primary"
                onClick={() => handleCheckout('exclusive')}
              >
                Get started with Exclusive
              </Button>
            </Paper>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
}

export default Pricing;
